  false,\n\t\"url\": null,\n\t\"notes\": \"This monitoring plan was developed in accordance
  with the environmental commitment plan contained in the final environmental assessment
  (FEA) and Finding of No Significant Impacts (FONSI) for the Conversion of Long-Term
  Water Service Contracts to Repayment Contracts for the Kirwin and Webster Irrigation
  Districts. These commitments were also included in the U.S. Fish and Wildlife Service's
  (FWS) biological opinion (BO). The monitoring plan will be in effect for a period
  of 5 years from the date of execution, but can be changed and/or adjusted at any
  time within that period upon agreement by the FWS and the Bureau of Reclamation
  (Reclamation). A plan will remain in effect until the least tern is delisted.\",\n\t\"license_title\":
